import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { useState, useEffect, useNavigate } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Navbar from "./components/Navbar/Navbar";
import TournamentForm from "./components/Form/formbckp.js";

const App = () => {
  const [inputs, setInputs] = useState({});
  const [tournaments, setTournaments] = useState("");

  useEffect(() => {
    const getTournaments = async () => {
      const tournamentsFromServer = await fetchTournaments();
      setTournaments(tournamentsFromServer);
    };

    getTournaments();
  }, []);

  const handleInputChange = (event) => {
    const target = event.target;
    const name = target.name;
    const value = target.value;
    setInputs((values) => ({ ...values, [name]: value }));
  };

  // Fetch Tournaments
  const fetchTournaments = async () => {
    const res = await fetch("http://localhost:5000/tournaments");
    const data = await res.json();

    return data;
  };

  // Fetch Tournament
  const fetchTournament = async (name) => {
    const res = await fetch(`http://localhost:5000/tournaments/${name}`);
    const data = await res.json();

    return data;
  };
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<TournamentForm />} />
      </Routes>
    </Router>
  );
};

export default App;
